import { Box, Typography } from '@mui/material'
import React from 'react'

function Header() {

    const nav_titles =[{
        path:'/',
        display:'Home'
    },
    {
        path:'/',
        display:'Dishes'
    },
    {
        path:'/',
        display:'Services'
    },
    {
        path:'/',
        display:'About us'
    }]
  return (
    <Box>
        <Box>
    <Box>
       {
         nav_titles.map((item,index)=>(
        <Typography>
         {item.display}
        </Typography>
         ))
       } 
        <Typography>
         
        </Typography>
    </Box>
        </Box>
        <Box>

        </Box>
    </Box>
  )
}

export default Header
